import pandas as pd
import matplotlib.pyplot as plt

# Function to calculate the size of clusters for each trial
def calculate_cluster_sizes(data, threshold=0.4):
    clusters = [[]]
    current_cluster = 0

    for i in range(len(data)):
        if data[i] <= threshold:
            clusters[current_cluster].append(data[i])
        else:
            clusters.append([])
            current_cluster += 1

    return [len(cluster) for cluster in clusters]

# Function to calculate the average cluster size for each section of trials
def calculate_average_cluster_sizes(ili_data):
    trial_sections = [ili_data[:10], ili_data[10:20], ili_data[20:30]]
    avg_cluster_sizes_sections = []

    for section_data in trial_sections:
        section_avg_cluster_sizes = [calculate_cluster_sizes(trial_data) for trial_data in section_data]
        section_avg_cluster_sizes = [sum(sizes) / len(sizes) for sizes in zip(*section_avg_cluster_sizes)]
        avg_cluster_sizes_sections.append(section_avg_cluster_sizes)

    return avg_cluster_sizes_sections

# Function to create bar graphs
def create_bar_graphs(animals_data, animal_names):
    for i, animal_data in enumerate(animals_data):
        fig, axs = plt.subplots(3, 1, figsize=(10, 12))
        trials = ["Trials 1-10", "Trials 11-20", "Trials 21-30"]

        for j, ax in enumerate(axs):
            avg_cluster_sizes_sections = calculate_average_cluster_sizes(animal_data)
            avg_cluster_sizes = avg_cluster_sizes_sections[j]

            x_pos = range(len(avg_cluster_sizes))
            ax.bar(x_pos, avg_cluster_sizes, align='center', alpha=0.7)
            ax.set_xticks(x_pos)  # Set the tick positions to match the number of bars
            ax.set_xticklabels(['Pre Citral', 'Post Citral', 'Pre Ethyl', 'Post Ethyl'])
            ax.set_title(f"{animal_names[i]} - {trials[j]}")
            ax.set_ylabel("Average Cluster Sizes (Licks)")

        plt.tight_layout()
        plt.show()

